    "title": "9th Masters Little Darling Is Trolling Again!",
    "author": "Listening to the Cold Rain",
    "description": "After her rebirth, Qin Yiyi became the daughter of the Qin Family once again. Its just that her parents didnt love her.Its alright. Ive always rel ...ways relied on myself.What? She had no education, no ability, no brain, and was not as smart and clever as Second Miss Qin?Qin Yiyi chuckled and turned to leave.Over the past year, she had gotten sick of being a top student at the piano and accidentally became an ancient cultural endorser while also somehow receiving a doctorate and accepted a professor as her discipleA top-ranked medical professional said, What, Master Qin isnt here? Sorry, were leaving too.Ancient martial arts family had this to say, Qin Yiyi is my little grandaunt. If you bully her, youre going against the ancient martial world!9th master chuckled. As he looked around, his thin lips curled up slightly. Everyone, do you think Im dead?",
