    "title": "A Female Forensic Doctor Transmigrates Into A Book As The Female Supporting Character",
    "author": "Mountain Spring",
    "description": "Yin Tao, a modern forensic doctor, transmigrated into a book and became the female leads older sister. At the same time, she was also the female supp ...pporting character for the female lead.After reincarnating, the female lead helped to grow the familys business and married a handsome, talented man. Ever since then, her career and love life began to prosper.However, Yin Tao, who lived with her grandparents in the book, had always been jealous of the female lead because everyone in the family favored her over Yin Tao. Yin Tao grew up and became a forensic doctor. However, due to the nature of her work, she was shunned by her family. In the end, after much pressure from her family, she quit her job and married a man from a rich family.Ever since then, she has had to become a people-pleaser. She could only stand firmly on her feet thanks to her own family and children. Yin Tao was not interested in living such a sorrowful life. All she wanted was to escape from the original storyline and live the simple life she desired.Hence, Yin Tao moved out of the house almost instantly. She moved into a dormitory and buried herself in her work as a criminal investigator. She dealt with corpses every day. She also made use of her knowledge of the books storyline to earn some money. Just as Yin Taos life was beginning to get better, and just when she thought she had escaped from the original storyline, a murder crime linked her to the male supporting character who was infatuated with the female lead.Feng Jing became her direct superior! Fortunately, he didnt seem interested in her in the least bit. One day, Yin Tao and Feng Jing found themselves standing before a bloated cadaver that was salvaged from the river. Feng Jings eyes widened while he looked at her. There was a glimmer in his eyes that could not quite be explained. Yin Tao started speaking hastily. Dont fall in love with me. Im only a myth. Feng Jing was speechless",
