    "title": "CLEAVER OF SIN",
    "author": "LORDTEE",
    "description": "Ethan possessed everything one could desire, wealth, happiness, luxury cars, and a loving girlfriend.He had never fought a day in his life, but then s ...uddenly, he woke up in a different world.A world were destruction and bloodshed was the norm. A world where the weak had no place to survive.Ethan now possessing the body of a boy who had failed his awakening twice and was on his last try, now stood in this world.Can Ethan who never fought a day in his life survive in a world where battles and death occurs every second, minute, hour and day.Would he rise through the ashes of the world, or would he burn with it",
