    "author": "NecroBin",
    "description": "Diving into dungeons, slaying monsters, and filming porn?When the mana apocalypse struck, 15% of humanity awakened supernatural abilities, becoming t ... the worlds new superstars: conquering dungeons, leveling up, and raking in fame and fortune.Kaiden wasnt one of them.Stuck among the powerless 85%, he was just another broke college student, until a banana peel sent him tumbling into a very unconventional system.Now, his path to power isnt through leveling up alone, but through fame as well. To thrive in this new world, hell have to master more than just dungeon clears and combat...Kaiden must conquer the world of adult content to rise to the apex.Blending action, romance, and slice-of-life, this novel aims to deliver an unforgettable adventure!",
