    "title": "Endless Winter: My Camp Upgrades Infinitely",
    "author": "",
    "description": "Have you ever seen a game where you start with a small campfire, surrounded by endless snowfields, you have to carry all resources by hand, and monste ...rs attack at any time?Xia Hong wakes up to find himself in exactly such a world.Blizzards ravage the land, Frost Beasts dominate the earth, civilization is lost.Everything and everyone from the past has been corrupted into powerful Abominations by the unknown.Humanity has been reduced to a lowly race surviving under the shadow of eternal winter, on the brink of extinction.Fortunately, Xia Hong possesses a Camp Upgrade System that can evolve endlessly:Small CampfireIron FurnaceSolar CauldronWooden StakeMartial Arts Training GroundDojoBamboo FenceBlack Earth WallIronclad WallMarker StoneNotice BoardHeroic MonumentAs Xia Hong slays frost beasts and abominations, gathers survivors, drives back the cold, and expands territory, the secrets of this frozen world begin to unfold",
