    "title": "Evolution Begins With A Big Tree",
    "author": "Crimson Night",
    "description": "Reborn as a Willow Tree!Before Yu Ziyu could adapt to this familiar yet unfamiliar environment, he had caught up with the era of Spiritual Energy resu ...rgence.With the resurgence of Spiritual Energy, the world started to shift. Mere beast could just roar, shaking mountains and rivers. Superhumans could now leap over the sky and split the world.At such turbulent times, a Willow Tree emerged from the ground, covering the sky and the sun.He could evolve infinitely, and the fruits he produces could endow others with strange supernatural powers. Just his mere aura could nourish beasts.Flying above him were the three generals of the elements. Meanwhiile, below him were the nine great beasts, sleeping on the ground.Some people call me The World Tree, singing me praises day and night.Some people call me The Tree of Beginnings, that I hold up the sky.Of course, more call me God Tree, Cursed Tree, Tree Demon Regardless of what label they give me, regardless of how many, all of them were in awe at my existence",
