    "title": "From Bullets To Billions",
    "author": "Jksmanga",
    "description": "The White Tiger Gang was the biggest and most feared group in the country, clawing its way from the bottom to the top all because of a single individu ...al, Maximus Darn. Reaching the Peak, he found nothing he couldnt have.One day, though, he lost it all. Betrayed from the inside, remembering the last few words: Money rules all.In death, Maximus finds he has been given a second chance, but not in his own body, but in the body of a young man named Max Stern.Wait, the Stern Family!!Now, he was the heir to the wealthiest family in the country, the Stern Family. With his newfound wealth, he was given a whole new life, but living in the Stern family wasnt the easy life one would expect.Spoiled brats, Wealthy snobs trying to one-up me. You have no idea where Ive come from. Ill show you all, what happens when you mess with White Tiger.Follow Maxmius as he builds a New empire using his wealth, and faces the very Gang, he created",
