    "title": "Global Era Of Star Trekking",
    "author": "Mountain high and ground distant",
    "description": "This was the great era of vast warships and the Star River, a time when the multi-universe was shattered and countless Cosmic Fragments were scattered ... across the void, forming the boundless Shattered Starry Sea.Immortal Domain Dao soldiers, mechanical gods, golden giants, wizard DominatorsAn endless array of strange civilizations.Starry Sea Oddity, Genetic Potions, exoskeletal armors, Floating Land OriginTreasures that could be found everywhere.Spectral Shuttle, Spectral Airship, Spectral Warship, Escort Ships, Battleships, Star-Annihilating Starships, hyperdimensional mother shipsThe clearly stratified Xinhuo warships.Song Chi held a Zhu Tian Ruins Market in his hand and engaged in interstellar trade with the countless peoples of the Starry Sea.What? Titanium Crystals are worthless in your Star Domain? Ill take them all, damn it, this is a strategic resource!You call this a chunk of iron? This is Mixed Elemental Copper, the ultimate Enhancement resource!Ordinary ship cannon? Isnt this a golden Star-Annihilating Cannon? Quick Ill buy it!Stretching across the stars, starting from the flame of human civilization",
