// Total counts
export const totalNovels = 54;
export const totalChapters = 4847;

// Helper functions
export function getNovelById(id: string): Novel | undefined {
  return novels.find(n => n.id === id);
}

export function getChapterById(novelId: string, chapterId: string): Chapter | undefined {
  const novel = getNovelById(novelId);
  return novel?.chapters.find(c => c.id === chapterId);
}

export function getLatestUpdates(limit: number = 12): Novel[] {
  return [...novels]
    .sort((a, b) => new Date(b.updatedAt).getTime() - new Date(a.updatedAt).getTime())
    .slice(0, limit);
}

export function getPopularNovels(limit: number = 6): Novel[] {
  return [...novels]
    .sort((a, b) => b.chapters.length - a.chapters.length)
    .slice(0, limit);
}

export function getTopRatedNovels(limit: number = 6): Novel[] {
  return [...novels]
    .sort((a, b) => b.rating - a.rating)
    .slice(0, limit);
}

export function getCompletedNovels(limit: number = 10): Novel[] {
  return novels
    .filter(n => n.status === 'Completed')
    .slice(0, limit);
}

export function searchNovels(query: string): Novel[] {
  const lowerQuery = query.toLowerCase();
  return novels.filter(n =>
    n.title.toLowerCase().includes(lowerQuery) ||
    n.author.toLowerCase().includes(lowerQuery) ||
    n.genres.some(g => g.toLowerCase().includes(lowerQuery))
  );
}

export function getNovelsByGenre(genre: string): Novel[] {
  const lowerGenre = genre.toLowerCase();
  return novels.filter(n =>
    n.genres.some(g => g.toLowerCase() === lowerGenre)
  );
}

export function getAllGenres(): string[] {
  const genres = new Set<string>();
  novels.forEach(n => n.genres.forEach(g => genres.add(g)));
  return Array.from(genres).sort();
}

// Genre list for filtering
export const availableGenres = getAllGenres();
